const foodLookup = (search) => {
  const first = () => {
    return new Promise((resolve, reject) => {
      resolve({ pages: 3 });
    });
  };

  const next = (page) => {
    return new Promise((resolve, reject) => {
      resolve({ pageGot: page });
    });
  };

  function load() {
    from(first())
      .pipe(
        switchMap(
          (data) => {
            const pages = Array.from(
              { length: data.pages - 1 },
              (x, idx) => idx + 2
            );

            const pageRequests = pages.map((page) => {
              return [`page${page}`, from(next(page))];
            });

            const observable = forkJoin({
              ...Object.fromEntries(pageRequests),
              page1: of(data),
            });
            return observable;
          }
        )
        ,
          map((d) => {
            console.log("mapping final map >>>", d);
            return d;
          })
      )
      .subscribe((res) => {
        console.log("res", res);
      });
  }

  load();

  return from(
    new Promise((resolve, reject) => {
      const data = dummyData.foods.reduce((nonDuplicates, food) => {
        nonDuplicates.set(food.description, food);
        return nonDuplicates;
      }, new Map());

      const res = Array.from(data.entries())
        .map(([key, val]) => {
          return {
            description: val.description,
            cal: val.foodNutrients[0].value,
            nutrition: extractNutrients(val.foodNutrients),
            popularNutrition: extractPopularNutrients(val.foodNutrients),
          };
        })
        .filter((v) => v);

      resolve(res);

      // resolve(dummyData);
    })
  );
};

export default foodLookup;

